// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;

contract PaymentTransaction {
    // Structure pour gérer les passerelles de paiement
    mapping(string => address) public gatewayAddresses;

    event GatewayAddressSet(string gatewayType, address gatewayAddress);

    // Fonction pour définir l'adresse de la passerelle
    function setGatewayAddress(string memory _gatewayType, address _gatewayAddress) public {
        require(_gatewayAddress != address(0), "Adresse de passerelle invalide.");
        gatewayAddresses[_gatewayType] = _gatewayAddress;
        emit GatewayAddressSet(_gatewayType, _gatewayAddress);
    }

    // Fonction pour récupérer l'adresse de la passerelle
    function getGatewayAddress(string memory _gatewayType) public view returns (address) {
        return gatewayAddresses[_gatewayType];
    }

    // Structure pour représenter une transaction de paiement
    struct PaymentTransactionInfo {
        uint transactionId;
        address payer;
        address payee;
        uint amount;
        string status;
        address gatewayAddress;
        string gatewayType;
        uint paymentTime;
        uint bonusAmount;
        string paymentType;
    }

    // Mapping pour stocker les transactions de paiement
    mapping(uint => PaymentTransactionInfo) public transactions;
    uint public transactionCounter;

    // Événements pour notifier les paiements
    event PaymentInitiated(uint transactionId, address payer, address payee, uint amount, uint bonusAmount);
    event PaymentCompleted(uint transactionId);
    event PaymentCancelled(uint transactionId);

    // Méthode pour initialiser un paiement avec une prime optionnelle
    function initiatePayment(uint _amount, uint _bonusAmount, address _recipient, string memory _gatewayType, string memory _paymentType) public returns (uint) {
        require(_amount > 0, "Le montant doit etre superieur a zero.");

        // Récupérer l'adresse de la passerelle à partir du type de passerelle
        address _gatewayAddress = getGatewayAddress(_gatewayType);
        require(_gatewayAddress != address(0), "Type de passerelle invalide ou non associe.");

        // Créer une nouvelle transaction
        transactionCounter++;
        transactions[transactionCounter] = PaymentTransactionInfo({
            transactionId: transactionCounter,
            payer: msg.sender,
            payee: _recipient,
            amount: _amount,
            status: "Initiated",
            gatewayAddress: _gatewayAddress,
            gatewayType: _gatewayType,
            paymentTime: block.timestamp,
            bonusAmount: _bonusAmount,
            paymentType: _paymentType
        });

        emit PaymentInitiated(transactionCounter, msg.sender, _recipient, _amount, _bonusAmount);
        return transactionCounter;
    }

    // Fonction pour recevoir un paiement
    function receivePayment(uint _transactionId) public {
        require(transactions[_transactionId].payee == msg.sender, "Vous n'etes pas le destinataire de ce paiement.");
        require(keccak256(abi.encodePacked(transactions[_transactionId].status)) == keccak256(abi.encodePacked("Initiated")), "Paiement deja termine.");
        recordTransaction(_transactionId);
    }

    // Méthode pour enregistrer une transaction
    function recordTransaction(uint _transactionId) internal {
        require(transactions[_transactionId].transactionId == _transactionId, "Transaction non trouvee.");
        transactions[_transactionId].status = "Completed";
        emit PaymentCompleted(_transactionId);
    }

    // Méthode pour annuler un paiement
    function cancelPayment(uint _transactionId) public {
        require(transactions[_transactionId].payer == msg.sender, "Seul le payeur peut annuler ce paiement.");
        require(keccak256(abi.encodePacked(transactions[_transactionId].status)) == keccak256(abi.encodePacked("Initiated")), "Paiement deja termine ou annule.");
        transactions[_transactionId].status = "Cancelled";
        emit PaymentCancelled(_transactionId);
    }

    // Méthode pour obtenir les détails d'une transaction
    function getTransactionDetails(uint _transactionId) public view returns (PaymentTransactionInfo memory) {
        return transactions[_transactionId];
    }
}

